import React, { Component } from 'react';
import filePic from "./file.svg";
import { Container, Row, Col } from 'reactstrap';
import menuPic from "./menu.svg";
import { MDBNavbar, MDBContainer, MDBNavLink, MDBNavItem, MDBNavbarToggler, MDBNavbarBrand, MDBNavbarNav, MDBCollapse }from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';

class File extends Component {
  state = {
    navbarCollapse2: ''

  }

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  };

  render() {
      return (
        <div className="element" >
          <Row>
            <Router><MDBNavbar color="bg-primary" style={{ marginTop: '20px' }} dark>
          <MDBContainer>
            <MDBNavbarBrand className="white-text">
              MDBNavbar
            </MDBNavbarBrand>
            <MDBNavbarToggler image="/docs/img/svg/arrow_right.svg" onClick={this.toggleCollapse('navbarCollapse2')} />
            <MDBCollapse id="navbarCollapse2" isOpen={this.state.collapseID} navbar>
              <MDBNavbarNav left>
                <MDBNavItem active>
                  <MDBNavLink to="#!">Home</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                  <MDBNavLink to="#!">Link</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                  <MDBNavLink to="#!">Profile</MDBNavLink>
                </MDBNavItem>
              </MDBNavbarNav>
            </MDBCollapse>
          </MDBContainer>
        </MDBNavbar>
</Router>
            <img className="menuPic"  src={menuPic} width="25px" alt="Folder"></img>
          </Row>
          <div className="clickeable">
            <Row>
              <img className="fileIcon" src={filePic} width="80px" alt="File"></img>
            </Row>
            <Row >
              <p className="textElement" width="60px">{this.props.labelFile}</p>
            </Row>
          </div>
        </div>
      );
    }
  }

  export default File;
